import React from 'react'
import SectionDestacada from "../../components/SectionDestacada"

function Home() {
    return (
        <React.Fragment>
        <main>
            <section class="titulo">
                <h2 class="tituSec">Populares</h2> 
                <a href="/populares" >Ver todas</a>
            </section>

        </main>
        </React.Fragment>
    )
}

export default Home;
